
<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">
<html xmlns="http://www.w3.org/1999/xhtml">
<head>
    <title>Liquidus Bannerlink</title>
</head>
<body>

<script type="text/javascript">
    var src2 = unescape(window.location.href.split("src=")[1]);
    if (src2.replace("http://", "").replace("https://", "").split("/")[0] == "b.liquidustv.com" && parent == top) {
        var scr = top.document.createElement("script");
        scr.setAttribute("type", "text/javascript");
        self.frameElement.parentNode.insertBefore(scr);
        scr.src = src2;
    }
</script>
</body>
</html>
